                ++idCount;
                temp.ProprietatiControl.IdHtml = idCount;

                // Console.WriteLine(temp.ProprietatiLabel.IdHtml + " " + temp.ProprietatiLabel.TopOffset + " " + temp.ProprietatiLabel.Color);

                rows.Add(temp);
            }

            editable = true;
        }
    }

